INSERT INTO `f_a_q_s` (`id`, `question`, `answer`, `description`, `created_at`, `updated_at`) VALUES
(5, 'What does AutoPulse Global Trading specialize in?', '<p><strong>AutoPulse Global Trading</strong> specializes in providing high-quality heavy machinery and electric vehicles, including electric bikes, scooters, and motorbikes. We cater to both individual customers (B2C) and businesses (B2B).</p>', '', '2025-03-02 17:44:25', '2025-03-02 17:44:25'),
(6, 'What types of heavy machinery do you offer?', '<p>We offer a wide range of heavy machinery, including construction equipment, industrial machines, agricultural tools, and more. Visit our Heavy Machinery page for detailed product listings.</p>', '', '2025-03-02 17:44:25', '2025-03-02 17:44:25'),
(7, 'Do you serve international customers?', '<p>Yes, we serve customers worldwide. Our products are available for export, and we ensure compliance with international shipping and regulatory standards.</p>', '', '2025-03-02 17:44:25', '2025-03-02 17:44:25'),
(8, 'Are your electric vehicles suitable for both personal and commercial use?', '<p>Yes, our electric vehicles are designed to meet the needs of both personal users looking for sustainable transportation options and businesses seeking fleet solutions.</p>', '', '2025-03-02 17:48:39', '2025-03-02 17:48:39'),
(9, 'Are spare parts and maintenance services available for heavy machinery?', '<p>Yes, we supply spare parts and offer maintenance services to keep your equipment running smoothly. Contact our support team for more details.</p>', '', '2025-03-02 17:48:39', '2025-03-02 17:48:39'),
(10, 'Do you provide training or operational support for heavy machinery?', '<p>Yes, we provide training resources and operational support to ensure that your team can safely and effectively use the machinery.</p>', '', '2025-03-02 17:48:39', '2025-03-02 17:48:39'),
(11, 'How can I place an order or request a quote?', '<p>You can place an order directly through our website or contact us directly to WhatsApp to request a quote for bulk purchases or customized solutions.</p>', '', '2025-03-02 17:48:39', '2025-03-02 17:48:39');
