(3, 15, NULL, 'asdf', NULL, '<p>asdfasdf</p>', 324.00, NULL, 234.00, 23443.00, '2024-05-21 08:05:43', '2024-05-29 14:20:22', '2024-05-29 14:20:22', 'public/images/categories/tSXWL4eqCmDJmOjn3uulA6eHvk4QtiWObbrHElsU.svg', 'product-664c9c276b4f7', 0, 1, '0', '', 0),
(4, 14, NULL, 'This is the product title', NULL, '<p style=\"text-align:start;\"><span style=\"color: rgb(49,51,55);background-color: rgb(73,29,144);font-size: inherit;font-family: Crimson Text\", serif;\">See how LogRocket\'s AI-powered error tracking works</span></p>\r\n<h3 style=\"margin-left:0px;\"><span style=\"color: rgb(49,51,55);background-color: rgb(73,29,144);font-size: 13px;font-family: Crimson Text\", serif;\">no signup required</span></h3>\r\n<p style=\"text-align:center;\"><span style=\"color: rgb(49,51,55);background-color: rgb(73,29,144);font-size: 16px;font-family: Crimson Text\", serif;\">Check it out</span></p>\r\n<p style=\"margin-left:-100px;\"></p>\r\n<iframe width=\"\" height=\"\" src=\"https://demo.arcade.software/42AVDUGKN01X9oBsIj5q?embed\" frameBorder=\"0\"></iframe>\r\n<p style=\"text-align:start;\"></p>\r\n<p style=\"text-align:start;\"><span style=\"color: rgb(49,51,55);background-color: rgb(255,255,255);font-size: 20px;font-family: Crimson Text\", serif;\"><strong><em>Editor’s note:</em></strong></span> <span style=\"color: rgb(49,51,55);background-color: rgb(255,255,255);font-size: 20px;font-family: Crimson Text\", serif;\"><em>This guide to building rich text editors in React was last updated on 1 December 2022 by</em></span> <a href=\"https://blog.logrocket.com/author/shalithasuranga/\" target=\"_self\"><span style=\"color: var(--color-purple);background-color: rgb(255,255,255);font-size: inherit;font-family: Crimson Text\", serif;\"><em>Shalitha Suranga</em></span></a> <span style=\"color: rgb(49,51,55);background-color: rgb(255,255,255);font-size: 20px;font-family: Crimson Text\", serif;\"><em>to reflect updates to React. This update added sections about the benefits of react-draft-wysiwyg, more information on Draft.js and react-draft-wysiwyg, and a section on using the</em></span> <span style=\"color: rgb(49,51,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Crimson Text\", serif;\"><code><em>UseEffect</em></code></span> <span style=\"color: rgb(49,51,55);background-color: rgb(255,255,255);font-size: 20px;font-family: Crimson Text\", serif;\"><em>Hook. To learn more about React Hooks check out our</em></span> <a href=\"https://blog.logrocket.com/react-reference-guide-hooks-api/\" target=\"_self\"><span style=\"color: var(--color-purple);background-color: rgb(255,255,255);font-size: inherit;font-family: Crimson Text\", serif;\"><em>React Hooks reference guide</em></span></a> <span style=\"color: rgb(49,51,55);background-color: rgb(255,255,255);font-size: 20px;font-family: Crimson Text\", serif;\"><em>and</em></span> <a href=\"https://blog.logrocket.com/react-hooks-cheat-sheet-unlock-solutions-to-common-problems-af4caf699e70/\" target=\"_self\"><span style=\"color: var(--color-purple);background-color: rgb(255,255,255);font-size: inherit;font-family: Crimson Text\", serif;\"><em>cheat sheet</em></span></a><span style=\"color: rgb(49,51,55);background-color: rgb(255,255,255);font-size: 20px;font-family: Crimson Text\", serif;\"><em>.</em></span></p>\r\n<img src=\"https://blog.logrocket.com/wp-content/uploads/2020/11/build-rich-text-editors-react-draft-js-react-draft-wysiwyg.png\" alt=\"Build Rich Text Editors in React Using Draft.js and react-draft-wysiwyg\" style=\"height: auto;width: \"/>\r\n<p style=\"text-align:start;\"><span style=\"color: rgb(49,51,55);background-color: rgb(255,255,255);font-size: 20px;font-family: Crimson Text\", serif;\">Frontend developers typically use plaintext inputs or</span> <span style=\"color: rgb(49,51,55);background-color: rgb(255,255,255);font-size: inherit;font-family: inherit;\"><code>textarea</code></span> <span style=\"color: rgb(49,51,55);background-color: rgb(255,255,255);font-size: 20px;font-family: Crimson Text\", serif;\">elements for capturing small-sized text segments, such as a username, address, or city. In some scenarios, they need to let users enter styled, formatted text with multi-media items in web applications. However, plaintext inputs can’t satisfy these requirements, so developers tend to use the rich text editors concept.</span></p>\r\n<p style=\"text-align:start;\"><span style=\"color: rgb(49,51,55);background-color: rgb(255,255,255);font-size: 20px;font-family: Crimson Text\", serif;\">Rich text editors have become integral in the way we interact with web applications especially when it comes to content generation. Web-based rich text editors are usually</span><a href=\"https://blog.logrocket.com/build-a-wysiwyg-text-editor-using-quill/\" target=\"_self\"> <span style=\"color: var(--color-purple);background-color: rgb(255,255,255);font-size: inherit;font-family: inherit;\">WYSIWYG HTML</span></a> <span style=\"color: rgb(49,51,55);background-color: rgb(255,255,255);font-size: 20px;font-family: Crimson Text\", serif;\">editors that offer a live preview of the styled and formatted text segments. Rich text editors enable you to control the appearance of the text and provide a powerful way for content creators to create and publish HTML anywhere.</span></p>\r\n<p style=\"text-align:start;\"><span style=\"color: rgb(49,51,55);background-color: rgb(255,255,255);font-size: 20px;font-family: Crimson Text\", serif;\">In this article, we will be using</span><a href=\"https://draftjs.org/\" target=\"_self\"> <span style=\"color: var(--color-purple);background-color: rgb(255,255,255);font-size: inherit;font-family: inherit;\">Draft.js</span></a> <span style=\"color: rgb(49,51,55);background-color: rgb(255,255,255);font-size: 20px;font-family: Crimson Text\", serif;\">and</span><a href=\"https://www.npmjs.com/package/react-draft-wysiwyg\" target=\"_self\"> <span style=\"color: var(--color-purple);background-color: rgb(255,255,255);font-size: inherit;font-family: inherit;\">react-draft-wysiwyg</span></a> <span style=\"color: rgb(49,51,55);background-color: rgb(255,255,255);font-size: 20px;font-family: Crimson Text\", serif;\">to build a rich text editor and display the text we created using the editor.</span></p>\r\n<p style=\"text-align:start;\"><span style=\"color: rgb(49,51,55);background-color: rgb(255,255,255);font-size: 20px;font-family: Crimson Text\", serif;\"><em>Jump ahead:</em></span></p>', 4.00, NULL, 404.00, 4.00, '2024-05-22 15:46:55', '2024-05-23 12:47:42', '2024-05-23 12:47:42', 'public/images/categories/isVyj0jgJiXEUM7CXh5z8eGEKOnrTqppz6ReoEwV.png', 'product-664e59bf1a13f', 0, 1, '0', '', 0),
