(7, 14, NULL, 'Title', '<p><br></p><h1>PHP</h1><p><strong>115 languages</strong></p><ul><li><a href=\"https://en.wikipedia.org/wiki/PHP\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-base,#202122);\">Article</a></li><li><a href=\"https://en.wikipedia.org/wiki/Talk:PHP\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Talk</a></li><li><a href=\"https://en.wikipedia.org/wiki/PHP\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-base,#202122);\">Read</a></li><li><a href=\"https://en.wikipedia.org/w/index.php?title=PHP&amp;action=edit\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Edit</a></li><li><a href=\"https://en.wikipedia.org/w/index.php?title=PHP&amp;action=history\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">View history</a></li></ul><p>Tools</p><p><br></p><ul><li><br></li><li><br></li><li><br></li><li><br></li><li><br></li><li><br></li><li><br></li><li><br></li><li><br></li><li><br></li><li><br></li><li><br></li><li><br></li><li><br></li><li><br></li></ul><p><br></p><p><a href=\"https://en.wikipedia.org/wiki/File:En-PHP.ogg\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\"><img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/4/47/Sound-icon.svg/20px-Sound-icon.svg.png\"></a></p><p>From Wikipedia, the free encyclopedia</p><p><br></p><p><em>This article is about the scripting language. For other uses, see&nbsp;</em><a href=\"https://en.wikipedia.org/wiki/PHP_(disambiguation)\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\"><em>PHP (disambiguation)</em></a><em>.</em></p><p><strong>PHP</strong><a href=\"https://en.wikipedia.org/wiki/File:PHP-logo.svg\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\"><img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/2/27/PHP-logo.svg/121px-PHP-logo.svg.png\"></a><a href=\"https://en.wikipedia.org/wiki/Programming_paradigm\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Paradigm</a><a href=\"https://en.wikipedia.org/wiki/Multi-paradigm_programming_language\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Multi-paradigm</a>:&nbsp;<a href=\"https://en.wikipedia.org/wiki/Imperative_programming\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">imperative</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Functional_programming\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">functional</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Object-oriented_programming\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">object-oriented</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Procedural_programming\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">procedural</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Reflective_programming\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">reflective</a><a href=\"https://en.wikipedia.org/wiki/Software_design\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Designed&nbsp;by</a><a href=\"https://en.wikipedia.org/wiki/Rasmus_Lerdorf\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Rasmus Lerdorf</a><a href=\"https://en.wikipedia.org/wiki/Software_developer\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Developer</a><a href=\"https://php.net/credits/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">The PHP Development Team</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Zend_Technologies\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Zend Technologies</a>,&nbsp;<a href=\"https://thephp.foundation/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">PHP Foundation</a>First&nbsp;appeared8&nbsp;June 1995; 28 years ago<a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-history-php-release-1\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[1]</a><a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-mysqlconference-2\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[2]</a><a href=\"https://en.wikipedia.org/wiki/Software_release_life_cycle\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Stable release</a>8.3.6 / 11&nbsp;April 2024; 42 days ago<a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-3\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[3]</a></p><ul><li><a href=\"https://en.wikipedia.org/wiki/Type_system\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Typing discipline</a><a href=\"https://en.wikipedia.org/wiki/Dynamic_typing\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Dynamic</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Strong_and_weak_typing\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">weak</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Gradual_typing\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">gradual</a><a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-4\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[4]</a>Implementation language<a href=\"https://en.wikipedia.org/wiki/C_(programming_language)\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">C</a>&nbsp;(primarily; some components&nbsp;<a href=\"https://en.wikipedia.org/wiki/C%2B%2B\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">C++</a>)<a href=\"https://en.wikipedia.org/wiki/Operating_system\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">OS</a><a href=\"https://en.wikipedia.org/wiki/Unix-like\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Unix-like</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Windows\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Windows</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/MacOS\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">macOS</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/IBM_i\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">IBM i</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/OpenVMS\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">OpenVMS</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/IBM_Z\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">IBM Z</a><a href=\"https://en.wikipedia.org/wiki/Software_license\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">License</a>dual licensed&nbsp;<a href=\"https://en.wikipedia.org/wiki/GNU_General_Public_License\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">GNU General Public License</a>&nbsp;version 2 or any later version and PHP License for PHP versions 3.0 or earlier.<a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-5\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[5]</a>&nbsp;Only&nbsp;<a href=\"https://en.wikipedia.org/wiki/PHP_License\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">PHP License</a>&nbsp;(most of Zend engine under&nbsp;<a href=\"https://en.wikipedia.org/wiki/Zend_Engine_License\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Zend Engine License</a>) for 3.01x and later versions.<a href=\"https://en.wikipedia.org/wiki/Filename_extension\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Filename extensions</a><span style=\"color: var(--color-emphasized,#000); background-color: var(--background-color-neutral-subtle,#f8f9fa);\">.php</span>,<span style=\"color: var(--color-emphasized,#000); background-color: var(--background-color-neutral-subtle,#f8f9fa);\">.phar</span>,<span style=\"color: var(--color-emphasized,#000); background-color: var(--background-color-neutral-subtle,#f8f9fa);\">.phtml</span>,<span style=\"color: var(--color-emphasized,#000); background-color: var(--background-color-neutral-subtle,#f8f9fa);\">.pht</span>,<span style=\"color: var(--color-emphasized,#000); background-color: var(--background-color-neutral-subtle,#f8f9fa);\">.phps</span>Website<a href=\"https://www.php.net/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">www.php.net</a>&nbsp;<a href=\"https://www.wikidata.org/wiki/Q59#P856\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\"><img src=\"https://upload.wikimedia.org/wikipedia/en/thumb/8/8a/OOjs_UI_icon_edit-ltr-progressive.svg/10px-OOjs_UI_icon_edit-ltr-progressive.svg.png\"></a>Major&nbsp;<a href=\"https://en.wikipedia.org/wiki/Programming_language_implementation\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">implementations</a><a href=\"https://en.wikipedia.org/wiki/Zend_Engine\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Zend Engine</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/HHVM\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">HHVM</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/PeachPie\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">PeachPie</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Quercus_(software)\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Quercus</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Parrot_virtual_machine\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Parrot</a>Influenced by<a href=\"https://en.wikipedia.org/wiki/Perl\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Perl</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/C_(programming_language)\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">C</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/C%2B%2B\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">C++</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Java_(programming_language)\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Java</a>,<a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-6\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[6]</a>&nbsp;<a href=\"https://en.wikipedia.org/wiki/Tcl\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Tcl</a>,<a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-mysqlconference-2\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[2]</a>&nbsp;<a href=\"https://en.wikipedia.org/wiki/JavaScript\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">JavaScript</a><a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-optimisation_ideas-7\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[7]</a>Influenced<a href=\"https://en.wikipedia.org/wiki/Hack_(programming_language)\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Hack</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Jakarta_Server_Pages\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">JSP</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Active_Server_Pages\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">ASP</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/React_(software)\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">React JS</a><a href=\"https://en.wikipedia.org/wiki/File:Wikibooks-logo-en-noslogan.svg\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\"><img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/d/df/Wikibooks-logo-en-noslogan.svg/16px-Wikibooks-logo-en-noslogan.svg.png\"></a>&nbsp;<a href=\"https://en.wikibooks.org/wiki/PHP_Programming\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">PHP Programming</a>&nbsp;at Wikibooks</li></ul><p><strong>PHP</strong>&nbsp;is a&nbsp;<a href=\"https://en.wikipedia.org/wiki/General-purpose_programming_language\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">general-purpose</a>&nbsp;<a href=\"https://en.wikipedia.org/wiki/Scripting_language\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">scripting language</a>&nbsp;geared towards&nbsp;<a href=\"https://en.wikipedia.org/wiki/Web_development\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">web development</a>.<a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-8\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[8]</a>&nbsp;It was originally created by&nbsp;<a href=\"https://en.wikipedia.org/wiki/Danish_Canadians\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Danish-Canadian</a>&nbsp;<a href=\"https://en.wikipedia.org/wiki/Programmer\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">programmer</a>&nbsp;<a href=\"https://en.wikipedia.org/wiki/Rasmus_Lerdorf\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Rasmus Lerdorf</a>&nbsp;in 1993 and released in 1995.<a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-:0-9\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[9]</a><a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-10\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[10]</a>&nbsp;The PHP&nbsp;<a href=\"https://en.wikipedia.org/wiki/Reference_implementation\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">reference implementation</a>&nbsp;is now produced by the PHP Group.<a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-about_PHP-11\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[11]</a>&nbsp;PHP was originally an abbreviation of&nbsp;<strong><em>Personal Home Page</em></strong>,<a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-History_of_PHP-12\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[12]</a><a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-13\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[13]</a>&nbsp;but it now stands for the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Recursive_initialism\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">recursive initialism</a>&nbsp;<strong><em>PHP: Hypertext Preprocessor</em></strong>.<a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-14\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[14]</a></p><p>PHP code is usually processed on a&nbsp;<a href=\"https://en.wikipedia.org/wiki/Web_server\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">web server</a>&nbsp;by a PHP&nbsp;<a href=\"https://en.wikipedia.org/wiki/Interpreter_(computing)\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">interpreter</a>&nbsp;implemented as a&nbsp;<a href=\"https://en.wikipedia.org/wiki/Plugin_(computing)\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">module</a>, a&nbsp;<a href=\"https://en.wikipedia.org/wiki/Daemon_(computing)\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">daemon</a>&nbsp;or a&nbsp;<a href=\"https://en.wikipedia.org/wiki/Common_Gateway_Interface\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Common Gateway Interface</a>&nbsp;(CGI) executable. On a web server, the result of the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Interpreter_(computing)\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">interpreted</a>&nbsp;and executed PHP code—which may be any type of data, such as generated&nbsp;<a href=\"https://en.wikipedia.org/wiki/HTML\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">HTML</a>&nbsp;or&nbsp;<a href=\"https://en.wikipedia.org/wiki/Binary_number\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">binary</a>&nbsp;image data—would form the whole or part of an&nbsp;<a href=\"https://en.wikipedia.org/wiki/HTTP\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">HTTP</a>&nbsp;response. Various&nbsp;<a href=\"https://en.wikipedia.org/wiki/Web_template_system\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">web template systems</a>, web&nbsp;<a href=\"https://en.wikipedia.org/wiki/Content_management_system\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">content management systems</a>, and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Web_framework\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">web frameworks</a>&nbsp;exist that can be employed to orchestrate or facilitate the generation of that response. Additionally, PHP can be used for many programming tasks outside the web context, such as standalone&nbsp;<a href=\"https://en.wikipedia.org/wiki/Graphical_user_interface\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">graphical applications</a><a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-15\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[15]</a>&nbsp;and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Unmanned_aerial_vehicle\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">drone</a>&nbsp;control.<a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-16\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[16]</a>&nbsp;PHP code can also be directly executed from the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Command-line_interface\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">command line</a>.</p><p>The standard PHP interpreter, powered by the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Zend_Engine\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Zend Engine</a>, is&nbsp;<a href=\"https://en.wikipedia.org/wiki/Free_software\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">free software</a>&nbsp;released under the&nbsp;<a href=\"https://en.wikipedia.org/wiki/PHP_License\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">PHP License</a>. PHP has been widely ported and can be deployed on most web servers on a variety of&nbsp;<a href=\"https://en.wikipedia.org/wiki/Operating_system\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">operating systems</a>&nbsp;and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Computing_platform\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">platforms</a>.<a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-foundations-17\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[17]</a></p><p>The PHP language has evolved without a written&nbsp;<a href=\"https://en.wikipedia.org/wiki/Formal_specification\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">formal specification</a>&nbsp;or standard, with the original&nbsp;<a href=\"https://en.wikipedia.org/wiki/Implementation\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">implementation</a>&nbsp;acting as the&nbsp;<a href=\"https://en.wikipedia.org/wiki/De_facto\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\"><em>de facto</em></a>&nbsp;standard that other implementations aimed to follow.</p><p>W3Techs reports that as of 23&nbsp;March&nbsp;2024&nbsp;(the four months after the PHP 8.3 release), PHP is used by 76.4% of all websites whose programming language could be determined, and 57.2% thereof use PHP 7 which is outdated and&nbsp;<span style=\"color: var( --color-emphasized, #595959 );\">known to be insecure.</span>[<a href=\"https://en.wikipedia.org/wiki/Wikipedia:Verifiability\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\"><em>failed verification</em></a>]<a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-PHP_Usage_Stats-18\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[18]</a></p><h2>History<span style=\"color: var(--color-subtle,#54595d);\">[</span><a href=\"https://en.wikipedia.org/w/index.php?title=PHP&amp;action=edit&amp;section=1\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">edit</a><span style=\"color: var(--color-subtle,#54595d);\">]</span></h2><p class=\"ql-align-center\"><a href=\"https://en.wikipedia.org/wiki/File:Rasmus_Lerdorf_cropped.jpg\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\"><img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/9/9c/Rasmus_Lerdorf_cropped.jpg/105px-Rasmus_Lerdorf_cropped.jpg\"></a></p><p class=\"ql-align-center\"><a href=\"https://en.wikipedia.org/wiki/File:Andi_Gutmans_1.jpg\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\"><img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/f/f6/Andi_Gutmans_1.jpg/105px-Andi_Gutmans_1.jpg\"></a></p><p class=\"ql-align-center\"><a href=\"https://en.wikipedia.org/wiki/File:Zeev_Suraski_2005_cropped.jpg\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\"><img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/c/cf/Zeev_Suraski_2005_cropped.jpg/105px-Zeev_Suraski_2005_cropped.jpg\"></a></p><p class=\"ql-align-center\"><a href=\"https://en.wikipedia.org/wiki/Rasmus_Lerdorf\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Rasmus Lerdorf</a>, creator of PHP; and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Andi_Gutmans\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Andi Gutmans</a>&nbsp;and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Zeev_Suraski\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Zeev Suraski</a>, creators of the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Zend_Engine\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Zend Engine</a></p><h3><strong>Early history</strong><strong style=\"color: var(--color-subtle,#54595d);\">[</strong><a href=\"https://en.wikipedia.org/w/index.php?title=PHP&amp;action=edit&amp;section=2\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\"><strong>edit</strong></a><strong style=\"color: var(--color-subtle,#54595d);\">]</strong></h3><p>PHP development began in 1993<a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-:0-9\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[9]</a>&nbsp;when&nbsp;<a href=\"https://en.wikipedia.org/wiki/Rasmus_Lerdorf\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Rasmus Lerdorf</a>&nbsp;wrote several&nbsp;<a href=\"https://en.wikipedia.org/wiki/Common_Gateway_Interface\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">Common Gateway Interface</a>&nbsp;(CGI) programs in&nbsp;<a href=\"https://en.wikipedia.org/wiki/C-programming\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">C</a>,<a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-php_origins-19\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[19]</a><a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-20\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[20]</a>&nbsp;which he used to maintain his&nbsp;<a href=\"https://en.wikipedia.org/wiki/Personal_homepage\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">personal homepage</a>. He extended them to work with&nbsp;<a href=\"https://en.wikipedia.org/wiki/Web_form\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">web forms</a>&nbsp;and to communicate with&nbsp;<a href=\"https://en.wikipedia.org/wiki/Database\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">databases</a>, and called this implementation \"Personal Home Page/Forms Interpreter\" or PHP/FI.</p><p>An example of the early PHP&nbsp;<a href=\"https://en.wikipedia.org/wiki/Syntax_(programming_languages)\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">syntax</a>:<a href=\"https://en.wikipedia.org/wiki/PHP#cite_note-21\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--color-progressive,#36c);\">[21]</a></p><p><span style=\"color: rgb(102, 102, 102);\">&lt;!--</span><span style=\"color: rgb(0, 128, 0);\">include</span> <span style=\"color: rgb(102, 102, 102);\">/</span>text<span style=\"color: rgb(102, 102, 102);\">/</span><span style=\"color: rgb(0, 128, 0);\">header</span><span style=\"color: rgb(102, 102, 102);\">.</span>html<span style=\"color: rgb(102, 102, 102);\">--&gt;</span></p><p><br></p><p><span style=\"color: rgb(102, 102, 102);\">&lt;!--</span><span style=\"color: rgb(0, 128, 0);\">getenv</span> HTTP_USER_AGENT<span style=\"color: rgb(102, 102, 102);\">--&gt;</span></p><p><span style=\"color: rgb(102, 102, 102);\">&lt;!--</span><span style=\"color: rgb(0, 128, 0);\">if</span> <span style=\"color: rgb(0, 128, 0);\">substr</span> <span style=\"color: rgb(25, 23, 124);\">$exec_result</span> Mozilla<span style=\"color: rgb(102, 102, 102);\">--&gt;</span></p><p>  Hey, you are using Netscape<span style=\"color: rgb(102, 102, 102);\">!&lt;</span>p<span style=\"color: rgb(102, 102, 102);\">&gt;</span></p><p><br></p>', '<h1><strong>features</strong></h1><ol><li>feature 1</li><li>feature 2</li><li>feature 3</li><li>feature 4</li><li>feature 5</li></ol>', 4.00, NULL, 423.00, 44.00, '2024-05-23 12:42:20', '2024-05-30 14:30:54', '2024-05-30 14:30:54', 'public/images/categories/t6ap2a4A4omVfGD80kfL98CstDSPiKtPuA7ASk9P.jpg', 'product-664f7ffc77b63', 0, 1, '0', '', 0),
